import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import TimeCounter from "../TimeCounter";

function Counter({ auth }) {
  return (
    <div className="row stylep" style={{ justifyContent: "center" }}>
      <div className="col-md-12 m-auto pt-4" align="center">
        <br /> <br />
        <h3 style={{ fontSize: "3rem" }} className="m-4 mx-auto text-center">
          CUPÓN DE DESCUENTO VÁLIDO HASTA...
          <br />
          <br />
          <TimeCounter hr={16} message="Cupon Expirado" />
        </h3>{" "}
        <br />
        <br />
        {auth.user.isPremium ? (
          <Link
            className="btn-orange btn shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/rep",
            }}
          >
            Ver clases
          </Link>
        ) : (
          <Link
            className="btn-orange btn shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/pago",
            }}
          >
            Comprar
          </Link>
        )}
        <br />
      </div>
    </div>
  );
}
const mapStateToProps = (state) => ({
  auth: state.auth,
});

const mapDispatchToProps = (dispatch, props) => ({});

export default connect(mapStateToProps, mapDispatchToProps)(Counter);
